import React, {useState, useEffect} from "react";
import logo from './logo.svg';
import './App.css';

function App() {
  const [data, setData] = useState(null);

  useEffect(() => {
        fetch('http://0.0.0.0:8888/json/sum?amountRUB=20000')
            .then(response => response.json())
            .then(response => setData(response))
      }, []
  )
    console.log(data)
    // const out = document.getElementById("demo").innerHTML = data;
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
            {
                document.getElementById("demo").innerHTML = data.usd + "," + data.eur + "," + data.jpy
                // !data ? "Loadind..." : data
            }
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
